def nucleotide_frequency(seq):
    """Counts frequency of each nucleotide in sequence"""
    tmpFreqDict = {"A": 0, "C": 0, "G": 0, "T": 0}
    for nuc in seq:
        tmpFreqDict[nuc] += 1
    return tmpFreqDict

DNAString = ""

result = nucleotide_frequency(DNAString)
print(' '.join([str(val) for key, val in result.items()]))
